import React from 'react';

const Logs = ({ logs }) => {
    // Ensure logs is an array
    const logArray = Array.isArray(logs) ? logs : [];

    return (
        <div>
            <div className='border'>
                <div className='mb-3'>
                    <h6 className='text-secondary'>Farm Logs</h6>
                </div>

                <table className="table table-striped table-hover">
                    <tbody>
                        {logArray.map((log) => (
                            <tr key={log.time || log.message}>
                                <td>{log.message}</td>
                                <td>{log.time}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default Logs;
